import {SnapEditSdk, SnapEditSdkType} from "./sdk";
import * as fs from 'fs';
const path = require('path');
// import FormData from 'form-data';
const sdk: SnapEditSdkType = new SnapEditSdk('089d84ac91c58e320de18bc7c9cb82c6051eabbd91efeac85dc37b250e5f5d44');

const base64 = 'data:image/jpeg;base64,'

const saveBase64Image = (base64Data: string, outputFilename: string) => {
    try {
        const base64Image = base64Data.split(';base64,').pop();


        const outputFilePath = path.join(__dirname, 'output', outputFilename);

        if (!fs.existsSync(path.join(__dirname, 'output'))) {
            fs.mkdirSync(path.join(__dirname, 'output'));
        }

        fs.writeFileSync(outputFilePath, Buffer.from(base64Image, 'base64'));

        console.log(`Image saved successfully to ${outputFilePath}`);
    } catch (error) {
        console.error('Error while saving base64 image:', error);
    }
};


async function main() {
    try {
        const response = await sdk.handleRemoveBg(base64);
        console.log(response, 'response');
        saveBase64Image(response, 'output_image.png');
    } catch (error) {
        // handleError(error);
        console.log(error, 'error');
        // console.error('Error response data:', error.response?.data);
        // console.error('Error status:', error.response?.status);
    }
}

function buildBody(data: any): string {
    if (!data) return '';

    if (data instanceof FormData) {
        let body = '';
        data.forEach((value: any, key: string) => {
            if (typeof value === 'object') {
                value = JSON.stringify(value);
            }
            body += `--form "${key}=${encodeURIComponent(value)}" `;
        });
        return body.trim();
    }

    return JSON.stringify(data);
}

function handleError(error: any) {
    const curlCommand = buildCurlCommand(error);
    console.error('Error:', error.message);
    console.error('Generated cURL command:\n', curlCommand);
    writeCurlToFile(curlCommand); // Ghi câu lệnh curl vào file
}

function buildCurlCommand(error: any): string {
    const method = error.config.method?.toUpperCase() || 'GET';
    const url = error.config.url || '';
    const headers = error.config.headers || {};
    const body = buildBody(error.config.data);

    let curl = `curl -X ${method} "${url}"`;

    for (const [key, value] of Object.entries(headers)) {
        curl += ` -H "${key}: ${value}"`;
    }

    if (body) {
        curl += ` ${body}`;
    }

    return curl;
}

function writeCurlToFile(curlCommand: string) {
    fs.writeFile('curl_command.txt', curlCommand, (err) => {
        if (err) {
            console.error('Error writing curl command to file:', err);
        } else {
            console.log('cURL command saved to curl_command.sh');
        }
    });
}
main();
